import React from 'react';

const Navigation = ({onRouteChange}) => {
	return(
		<nav className='fr pr4'>
			<p onClick={ () => onRouteChange('signin')} className='f3 link dim black underline ba3 pointer'>Sign Out</p>
		</nav>
		)
}

export default Navigation;
